	<script  type="text/javascript" charset="utf-8">
	 window.boot = function () {
    var settings = window._CCSettings;
    window._CCSettings = undefined;
    var onProgress = null;
    
    var RESOURCES = cc.AssetManager.BuiltinBundleName.RESOURCES;
    var INTERNAL = cc.AssetManager.BuiltinBundleName.INTERNAL;
    var MAIN = cc.AssetManager.BuiltinBundleName.MAIN;
    function setLoadingDisplay () {
        // Loading splash scene
        var splash = document.getElementById('splash');
        var progressBar = splash.querySelector('.progress-bar span');
        onProgress = function (finish, total) {
            var percent = 100 * finish / total;
            if (progressBar) {
                progressBar.style.width = percent.toFixed(2) + '%';
            }
        };
        splash.style.display = 'block';
        progressBar.style.width = '0%';

        cc.director.once(cc.Director.EVENT_AFTER_SCENE_LAUNCH, function () {
            splash.style.display = 'none';
        });
    }

    var onStart = function () {

        cc.view.enableRetina(true);
        cc.view.resizeWithBrowserSize(true);

        if (cc.sys.isBrowser) {
            setLoadingDisplay();
        }

        if (cc.sys.isMobile) {
            if (settings.orientation === 'landscape') {
                cc.view.setOrientation(cc.macro.ORIENTATION_LANDSCAPE);
            }
            else if (settings.orientation === 'portrait') {
                cc.view.setOrientation(cc.macro.ORIENTATION_PORTRAIT);
            }
            cc.view.enableAutoFullScreen([
                cc.sys.BROWSER_TYPE_BAIDU,
                cc.sys.BROWSER_TYPE_BAIDU_APP,
                cc.sys.BROWSER_TYPE_WECHAT,
                cc.sys.BROWSER_TYPE_MOBILE_QQ,
                cc.sys.BROWSER_TYPE_MIUI,
                cc.sys.BROWSER_TYPE_HUAWEI,
                cc.sys.BROWSER_TYPE_UC,
            ].indexOf(cc.sys.browserType) < 0);
        }

        // Limit downloading max concurrent task to 2,
        // more tasks simultaneously may cause performance draw back on some android system / browsers.
        // You can adjust the number based on your own test result, you have to set it before any loading process to take effect.
        if (cc.sys.isBrowser && cc.sys.os === cc.sys.OS_ANDROID) {
            cc.assetManager.downloader.maxConcurrency = 2;
            cc.assetManager.downloader.maxRequestsPerFrame = 2;
        }

        var launchScene = settings.launchScene;
        var bundle = cc.assetManager.bundles.find(function (b) {
            return b.getSceneInfo(launchScene);
        });
        
        bundle.loadScene(launchScene, null, onProgress,
            function (err, scene) {
                if (!err) {
                    cc.director.runSceneImmediate(scene);
                    if (cc.sys.isBrowser) {
                        // show canvas
                        var canvas = document.getElementById('GameCanvas');
                        canvas.style.visibility = '';
                        var div = document.getElementById('GameDiv');
                        if (div) {
                            div.style.backgroundImage = '';
                        }
                        console.log('Success to load scene: ' + launchScene);
                    }
                }
            }
        );

    };

    var option = {
        id: 'GameCanvas',
        debugMode: settings.debug ? cc.debug.DebugMode.INFO : cc.debug.DebugMode.ERROR,
        showFPS: settings.debug,
        frameRate: 60,

osition,\\n  vec4 lightPositionAndRange,\\n  vec4 lightDirection,\\n  vec4 lightColor\\n) {\\n  LightInfo ret;\\n  vec3 lightDir = lightPositionAndRange.xyz - worldPosition;\\n  float attenuation = max(0., 1.0 - length(lightDir) / lightPositionAndRange.w);\\n  lightDir = normalize(lightDir);\\n  float cosConeAngle = max(0., dot(lightDirection.xyz, -lightDir));\\n  cosConeAngle = cosConeAngle < lightDirection.w ? 0. : cosConeAngle;\\n  cosConeAngle = pow(cosConeAngle, lightColor.w);\\n  ret.lightDir = lightDir;\\n  ret.radiance = lightColor.rgb * attenuation * cosConeAngle;\\n  ret.lightColor = lightColor;\\n  return ret;\\n}\\nstruct Lighting {\\n  vec3 diffuse;\\n  vec3 specular;\\n};\\nstruct PhongSurface {\\n  vec3 diffuse;\\n  vec3 emissive;\\n  vec3 specular;\\n  float opacity;\\n  float glossiness;\\n  vec3 position;\\n  vec3 normal;\\n  vec3 viewDirection;\\n};\\nLighting brdf (PhongSurface s, LightInfo info) {\\n  Lighting result;\\n  float ndh = 0.0;\\n  vec3 halfDir = normalize(s.viewDirection + info.lightDir);\\n  float NdotH = max(0.0, dot(s.normal, halfDir));\\n  NdotH = pow(NdotH, max(1.0, s.glossiness * 128.0));\\n  result.diffuse = info.radiance * max(0.0, dot(s.normal, info.lightDir));\\n  result.specular = info.radiance * NdotH;\\n  return result;\\n}\\nvec4 composePhongShading (Lighting lighting, PhongSurface s) {\\n  vec4 o = vec4(0.0, 0.0, 0.0, 1.0);\\n  o.rgb = lighting.diffuse * s.diffuse;\\n  #if USE_EMISSIVE\\n    o.rgb += s.emissive;\\n  #endif\\n  #if USE_SPECULAR\\n    o.rgb += lighting.specular * s.specular;\\n  #endif\\n  o.a = s.opacity;\\n  return o;\\n}\\nvec3 ambient(PhongSurface s, vec4 ambientColor) {\\n  return s.diffuse * ambientColor.rgb;\\n}\\nvec4 CCPhongShading (in PhongSurface s) {\\n  Lighting result;\\n  result.diffuse = vec3(0, 0, 0);\\n  result.specular = vec3(0, 0, 0);\\n  #if CC_NUM_LIGHTS > 0\\n    #if CC_LIGHT_0_TYPE == 3\\n      result.diffuse += ambient(s, cc_lightColor[0]);\\n    #else\\n      LightInfo info0;\\n
